// import React from 'react';
import logo from './logo.svg';
import './App.css';
// import React, { Component } from 'react'

class App extends Component{
  constructor(){
    super()
    this.state={
      todo:["saimoon","nabeel","ghous"]
    }
  }
  render(){
    return(
      <div>
        <ul>
          {this.state.todo.map((v,i)=>{
            return <li>{v}</li>
          })}
          </ul>  
      </div>
    )
  }
}





export default App;
